func TestLogin(t *testing.T) {
	buf, err := hex.DecodeString("0000004c6c6f67696e5f757365720000000000000000000000000000000000000000000000000001757365726b65793d3435356464623130376437383265393963663538643861656135373039316165")
	if err != nil {
		panic(err)
	}
	cmd := NewSendData(buf)

	fmt.Println(cmd.String())
	cmd.Print()
}
